import React, { Component} from "react";

class State extends Component {
    constructor(props){
        super(props);
        this.state = {
            num: 1,
            facts: false}
    }
    render() {
        return(
        <div>
            <h1>The number is: {this.state.num}</h1>
        </div>
        )
    }
}

export default State;
